    [],nt"revision_timestamp": "2016-10-15T16:36:23.941274",nt"name": "iroquois-national-wildlife-refuge-annual-narrative-report-calendar-year-1983",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Iroquois
    NWR outlines Refuge accomplishments during the 1983 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses research and
    investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
    and haying. The wildlife section of the report discusses endangered and threatened
    species, migratory birds, game mammals, fishery resources, animal controo, and marking
    and bird banding. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, recreational uses, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and energy conservation. Items of interest are provided at the end. Photographs
    and newspaper articles are attached.",nt"license_title": "License Not Specified",nt"extras":
